    data: |
      SELECT + 95 AS col0, col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( + col1 + col1 * col0 IS NULL );
  - name: tab1

outputs:
  - name: q10661.out
    data: |
      95	51
      95	85
      95	91
